import React, { useState } from "react";
import {
    TextField,
    Button,
    Typography,
    Container,
    Box,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Paper,
} from "@mui/material";
import Pagination from "@mui/material/Pagination";

const AddStudent = () => {
    // State for student details
    const [students, setStudents] = useState([]);
    const [name, setName] = useState("");
    const [regNumber, setRegNumber] = useState("");
    const [standard, setStandard] = useState("");
    const [dob, setDob] = useState("");
    const [classTeacher, setClassTeacher] = useState("");
    const [page, setPage] = useState(1);

    // Number of items per page
    const rowsPerPage = 5;

    const handleSubmit = (e) => {
        e.preventDefault();
        const newStudent = {
            id: students.length + 1,
            name,
            regNumber,
            standard,
            dob,
            classTeacher,
        };

        setStudents([...students, newStudent]);
        setName("");
        setRegNumber("");
        setStandard("");
        setDob("");
        setClassTeacher("");
    };

    // Pagination logic
    const handleChangePage = (event, value) => {
        setPage(value);
    };

    const displayStudents = students.slice((page - 1) * rowsPerPage, page * rowsPerPage);

    return (
        <Container>
            <Typography variant="h4" gutterBottom>
                Add Student
            </Typography>

            <form onSubmit={handleSubmit}>
                <Box mb={2}>
                    <TextField
                        label="Name"
                        fullWidth
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        required
                    />
                </Box>
                <Box mb={2}>
                    <TextField
                        label="Reg Number"
                        fullWidth
                        value={regNumber}
                        onChange={(e) => setRegNumber(e.target.value)}
                        required
                    />
                </Box>
                <Box mb={2}>
                    <TextField
                        label="Standard"
                        fullWidth
                        value={standard}
                        onChange={(e) => setStandard(e.target.value)}
                        required
                    />
                </Box>
                <Box mb={2}>
                    <TextField
                        label="Date of Birth"
                        fullWidth
                        type="date"
                        value={dob}
                        onChange={(e) => setDob(e.target.value)}
                        InputLabelProps={{
                            shrink: true,
                        }}
                        required
                    />
                </Box>
                <Box mb={2}>
                    <TextField
                        label="Class Teacher"
                        fullWidth
                        value={classTeacher}
                        onChange={(e) => setClassTeacher(e.target.value)}
                        required
                    />
                </Box>

                <Button variant="contained" color="primary" type="submit">
                    Add Student
                </Button>
            </form>

            <Typography variant="h5" gutterBottom mt={4}>
                Students List
            </Typography>

            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>S.No</TableCell>
                            <TableCell>Name</TableCell>
                            <TableCell>Reg Number</TableCell>
                            <TableCell>Standard</TableCell>
                            <TableCell>D.O.B</TableCell>
                            <TableCell>Class Teacher</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {displayStudents.map((student, index) => (
                            <TableRow key={student.id}>
                                <TableCell>{(page - 1) * rowsPerPage + index + 1}</TableCell>
                                <TableCell>{student.name}</TableCell>
                                <TableCell>{student.regNumber}</TableCell>
                                <TableCell>{student.standard}</TableCell>
                                <TableCell>{student.dob}</TableCell>
                                <TableCell>{student.classTeacher}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>

            <Pagination
                count={Math.ceil(students.length / rowsPerPage)}
                page={page}
                onChange={handleChangePage}
                color="primary"
                sx={{ mt: 2 }}
            />
        </Container>
    );
};

export default AddStudent;
